"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[8162],{62332:(e,a,o)=>{o.r(a),o.d(a,{default:()=>t});var r=o(78e3);const s=[(0,r.uE)('<p><strong>Flujo de Trabajo Activo:</strong> Cuando se genera el siguiente mensaje como consecuencia de un flujo de trabajo activo en Solop ERP.</p><p><img src="/assets/img/docs/basic-rules/bar-props-flow.png" alt="Flujo de Trabajo Activo"></p><p>Imagen 5. Flujo de Trabajo Activo</p><p>Es necesario anular dicho flujo de trabajo. Para ello se debe realizar el siguiente procedimiento.</p><p>Seleccione el icono <strong>Flujos de Trabajos Activos</strong>, ubicado en la barra de herramientas de la ventana en la cual fue presentado el mensaje de flujo de trabajo activo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-flow-2.png" alt="Icono Flujo de Trabajo Activo"></p><p>Imagen 6. Icono Flujo de Trabajo Activo</p><p>Podrá visualizar la ventana <strong>Proceso de Flujo de Trabajo</strong>, con el registro del flujo de trabajo activo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-cancel.png" alt="Flujo de Trabajo a anular"></p><p>Imagen 7. Flujo de Trabajo a anular</p><p>Luego de haber ubicado el flujo de trabajo activo, debe seleccionar la opción <strong>Manejador de Procesos</strong>.</p><p><img src="/assets/img/docs/basic-rules/bar-props-process.png" alt="Opción Manejador de Procesos"></p><p>Imagen 8. Opción Manejador de Procesos</p><p>Podrá visualizar la ventana <strong>Manejador de Procesos</strong>, que se utiliza para actualizar o detener el proceso de flujo de trabajo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-process-2.png" alt="Ventana Manejador de Procesos"></p><p>Imagen 9. Ventana Manejador de Procesos</p><p>Seleccione el check <strong>Anular Proceso</strong>, para anular el flujo de trabajo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-process-3.png" alt="Check Anular Proceso"></p><p>Imagen 10. Check Anular Proceso</p><p>Finalmente, seleccione la opción <strong>OK</strong>, para ejecutar la acción requerida de acuerdo a lo indicado en la ventana <strong>Manejador de Procesos</strong>.</p><p><img src="/assets/img/docs/basic-rules/bar-props-ok.png" alt="Opción OK"></p><p>Imagen 11. Opción OK</p><p>En el caso de que continue el mismo mensaje de flujo de trabajo activo, ubique nuevamente el registro de flujo de trabajo, con la ayuda del icono <strong>Flujos de Trabajos Activos</strong>, desde la ventana en la cual fue presentado dicho mensaje. Posteriormente podrá visualizar la ventana <strong>Proceso de Flujo de Trabajo</strong>, con el registro del flujo de trabajo activo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-job.png" alt="Flujo de Trabajo a anular"></p><p>Imagen 12. Flujo de Trabajo a anular</p><p>Seleccione la pestaña <strong>Actividad</strong>, para visualizar el registro que se encuentra en estado <strong>Terminado</strong>.</p><p><img src="/assets/img/docs/basic-rules/bar-props-job-2.png" alt="Flujo de Trabajo"></p><p>Imagen 13. Flujo de Trabajo</p><p>Luego seleccione la opción <strong>Manejador de Actividades</strong>.</p><p><img src="/assets/img/docs/basic-rules/bar-props-activities.png" alt="Opción Manejador de Actividades"></p><p>Imagen 14. Opción Manejador de Actividades</p><p>Podrá visualizar la ventana <strong>Manejador de Actividades</strong>, que se utiliza para actualizar o detener la actividad del flujo de trabajo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-activities-2.png" alt="Ventana Manejador de Actividades"></p><p>Imagen 15. Ventana Manejador de Actividades</p><p>Seleccione el check <strong>Anular Proceso</strong>, para anular el flujo de trabajo.</p><p><img src="/assets/img/docs/basic-rules/bar-props-cancel-2.png" alt="Check Anular Proceso"></p><p>Imagen 16. Check Anular Proceso</p><p>Finalmente, seleccione la opción <strong>OK</strong>, para ejecutar la acción requerida de acuerdo a lo indicado en la ventana <strong>Manejador de Actividades</strong>.</p><p><img src="/assets/img/docs/basic-rules/bar-props-ok-2.png" alt="Opción OK"></p><p>Imagen 17. Opción OK</p>',40)],n={},t=(0,o(13860).Z)(n,[["render",function(e,a){return(0,r.wg)(),(0,r.iD)("div",null,s)}]])},29133:(e,a,o)=>{o.r(a),o.d(a,{data:()=>r});const r=JSON.parse('{"key":"v-cda35152","path":"/docs/basic-rules/workflows.html","title":"Flujos de Trabajo","lang":"es-ES","frontmatter":{"title":"Flujos de Trabajo","category":["Documentation"],"star":9,"sticky":9,"article":false,"summary":"Flujo de Trabajo Activo: Cuando se genera el siguiente mensaje como consecuencia de un flujo de trabajo activo en Solop ERP. Imagen 5. Flujo de Trabajo Activo Es necesario anular d","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/basic-rules/workflows.html"}],["meta",{"property":"og:title","content":"Flujos de Trabajo"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2024-01-09T20:54:14.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:modified_time","content":"2024-01-09T20:54:14.000Z"}]]},"excerpt":"","headers":[],"git":{"createdTime":1704833654000,"updatedTime":1704833654000,"contributors":[{"name":"mgarciaQ76","email":"139590879+mgarciaQ76@users.noreply.github.com","commits":1}]},"readingTime":{"minutes":1.77,"words":530},"filePathRelative":"docs/basic-rules/workflows.md","localizedDate":"9 de enero de 2024"}')}}]);